import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [users, setUsers] = useState([])

  useEffect(() => {
    const getUsers = async () => {
      const response = await axios('http://0.0.0.0:8080/users?access_token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY2MTBmYzI5ZmQ0Zjk3M2ZhMWJlODQzMiIsImlhdCI6MTcxMjM5MjcwOCwiZXhwIjoxNzEyMzk2MzA4fQ.ziBqYeKs5XALQzcNo_DexWRIv3mIvTpwIDkT3R76LaA')
      setUsers(response.data)
    }
    getUsers() 
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload. hahahah
        </p>
        <a
          className="App-link"
          href="https://www.baidu.com"
          target="_blank"
          rel="noopener noreferrer"
          style={{color: "red", fontSize: "50px"}}
        >
          Learn React 123 {users.length}
        </a>
        <div>
          {users?.[0]?.id}
        </div>
        <div>
          {users?.[0]?.id}
        </div>
        <div>
          {users?.[0]?.id}
        </div>
      </header>
    </div>
  );
}

export default App;
